import React, { useState } from 'react';
import { Anomaly } from '../types/insights';
import { AlertTriangle, TrendingUp, GitBranch, Zap, ChevronDown, ChevronRight } from 'lucide-react';

interface AnomaliesTableProps {
  anomalies: Anomaly[];
}

const AnomaliesTable: React.FC<AnomaliesTableProps> = ({ anomalies }) => {
  const [expandedRows, setExpandedRows] = useState<Set<string>>(new Set());
  const [filterSeverity, setFilterSeverity] = useState<string>('all');
  const [filterType, setFilterType] = useState<string>('all');

  const toggleRow = (id: string) => {
    const newExpanded = new Set(expandedRows);
    if (newExpanded.has(id)) {
      newExpanded.delete(id);
    } else {
      newExpanded.add(id);
    }
    setExpandedRows(newExpanded);
  };

  const getSeverityColor = (severity: string) => {
    switch (severity) {
      case 'critical': return 'bg-red-100 text-red-800 border-red-200';
      case 'high': return 'bg-orange-100 text-orange-800 border-orange-200';
      case 'medium': return 'bg-yellow-100 text-yellow-800 border-yellow-200';
      case 'low': return 'bg-blue-100 text-blue-800 border-blue-200';
      default: return 'bg-gray-100 text-gray-800 border-gray-200';
    }
  };

  const getTypeIcon = (type: string) => {
    switch (type) {
      case 'burst_correlation': return <Zap className="h-4 w-4" />;
      case 'lead_lag': return <TrendingUp className="h-4 w-4" />;
      case 'pmi_correlation': return <GitBranch className="h-4 w-4" />;
      case 'change_attribution': return <AlertTriangle className="h-4 w-4" />;
      default: return <AlertTriangle className="h-4 w-4" />;
    }
  };

  const getTypeColor = (type: string) => {
    switch (type) {
      case 'burst_correlation': return 'text-blue-600';
      case 'lead_lag': return 'text-green-600';
      case 'pmi_correlation': return 'text-purple-600';
      case 'change_attribution': return 'text-orange-600';
      default: return 'text-gray-600';
    }
  };

  const formatTypeLabel = (type: string) => {
    switch (type) {
      case 'burst_correlation': return 'Burst Correlation';
      case 'lead_lag': return 'Lead-Lag';
      case 'pmi_correlation': return 'PMI Co-occurrence';
      case 'change_attribution': return 'Change Attribution';
      default: return type;
    }
  };

  const filteredAnomalies = anomalies.filter(anomaly => {
    const severityMatch = filterSeverity === 'all' || anomaly.severity === filterSeverity;
    const typeMatch = filterType === 'all' || anomaly.type === filterType;
    return severityMatch && typeMatch;
  });

  const renderDetails = (anomaly: Anomaly) => {
    const details = anomaly.details;

    switch (anomaly.type) {
      case 'burst_correlation':
        return (
          <div className="grid grid-cols-2 gap-4 text-sm">
            <div>
              <span className="font-medium">Correlation:</span> {details.correlation?.toFixed(3)}
            </div>
            <div>
              <span className="font-medium">P-value:</span> {details.p_value?.toExponential(2)}
            </div>
            <div>
              <span className="font-medium">Aligned Bursts:</span> {details.aligned_bursts}
            </div>
            <div>
              <span className="font-medium">Sample Size:</span> {details.sample_size}
            </div>
            <div className="col-span-2">
              <span className="font-medium">Confidence Interval:</span> [{details.confidence_interval?.[0]?.toFixed(3)}, {details.confidence_interval?.[1]?.toFixed(3)}]
            </div>
          </div>
        );

      case 'lead_lag':
        return (
          <div className="grid grid-cols-2 gap-4 text-sm">
            <div>
              <span className="font-medium">Lag:</span> {details.lag_seconds}s ({details.direction})
            </div>
            <div>
              <span className="font-medium">Correlation:</span> {details.correlation?.toFixed(3)}
            </div>
            <div>
              <span className="font-medium">Granger Score:</span> {details.granger_score?.toFixed(3)}
            </div>
            <div>
              <span className="font-medium">Confidence:</span> {details.confidence?.toFixed(3)}
            </div>
          </div>
        );

      case 'pmi_correlation':
        return (
          <div className="grid grid-cols-2 gap-4 text-sm">
            <div>
              <span className="font-medium">PMI Score:</span> {details.pmi_score?.toFixed(2)}
            </div>
            <div>
              <span className="font-medium">Support:</span> {details.support}
            </div>
            <div>
              <span className="font-medium">Confidence:</span> {details.confidence?.toFixed(3)}
            </div>
            <div>
              <span className="font-medium">Total Buckets:</span> {details.total_buckets}
            </div>
          </div>
        );

      case 'change_attribution':
        return (
          <div className="grid grid-cols-2 gap-4 text-sm">
            <div>
              <span className="font-medium">Correlation:</span> {details.correlation_coefficient?.toFixed(3)}
            </div>
            <div>
              <span className="font-medium">Lag:</span> {details.lag_minutes?.toFixed(1)} min
            </div>
            <div>
              <span className="font-medium">Change Count:</span> {details.change_count}
            </div>
            <div>
              <span className="font-medium">Effect Count:</span> {details.effect_count}
            </div>
          </div>
        );

      default:
        return <pre className="text-xs bg-gray-50 p-2 rounded overflow-auto">{JSON.stringify(details, null, 2)}</pre>;
    }
  };

  return (
    <div className="space-y-6">
      {/* Professional Filters */}
      <div className="bg-gray-50 rounded-xl p-6">
        <div className="flex items-center justify-between mb-4">
          <h3 className="text-lg font-semibold text-gray-900">Filter Anomalies</h3>
          <div className="text-sm text-gray-500">
            {filteredAnomalies.length} of {anomalies.length} anomalies
          </div>
        </div>
        <div className="flex flex-wrap gap-6">
          <div className="flex-1 min-w-48">
            <label className="block text-sm font-medium text-gray-700 mb-2">Severity Level</label>
            <select
              value={filterSeverity}
              onChange={(e) => setFilterSeverity(e.target.value)}
              className="input w-full"
            >
              <option value="all">All Severities</option>
              <option value="critical">Critical</option>
              <option value="high">High</option>
              <option value="medium">Medium</option>
              <option value="low">Low</option>
            </select>
          </div>

          <div className="flex-1 min-w-48">
            <label className="block text-sm font-medium text-gray-700 mb-2">Anomaly Type</label>
            <select
              value={filterType}
              onChange={(e) => setFilterType(e.target.value)}
              className="input w-full"
            >
              <option value="all">All Types</option>
              <option value="burst_correlation">Burst Correlation</option>
              <option value="lead_lag">Lead-Lag</option>
              <option value="pmi_correlation">PMI Co-occurrence</option>
              <option value="change_attribution">Change Attribution</option>
            </select>
          </div>
        </div>
      </div>

      {/* Professional Table */}
      <div className="card">
        <div className="overflow-hidden">
          <table className="table">
            <thead>
              <tr>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  Anomaly Details
                </th>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  Type
                </th>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  Severity
                </th>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  Detected
                </th>
                <th className="px-6 py-4 text-left text-xs font-semibold text-gray-600 uppercase tracking-wider">
                  Actions
                </th>
              </tr>
            </thead>
            <tbody>
              {filteredAnomalies.map((anomaly, index) => (
                <React.Fragment key={anomaly.id}>
                  <tr className="hover:bg-gray-50 transition-colors">
                    <td className="px-6 py-4">
                      <div className="flex items-start space-x-3">
                        <div className="flex-shrink-0 mt-1">
                          <AlertTriangle className="h-5 w-5 text-red-500" />
                        </div>
                        <div className="min-w-0 flex-1">
                          <div className="text-sm font-medium text-gray-900 mb-1">
                            {anomaly.message}
                          </div>
                          <div className="text-xs text-gray-500">
                            ID: {anomaly.id}
                          </div>
                        </div>
                      </div>
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap">
                      <div className={`flex items-center space-x-2 ${getTypeColor(anomaly.type)}`}>
                        {getTypeIcon(anomaly.type)}
                        <span className="text-sm font-medium">
                          {formatTypeLabel(anomaly.type)}
                        </span>
                      </div>
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap">
                      <span className={`badge ${getSeverityColor(anomaly.severity).replace('bg-', 'badge-').replace(' text-', ' ').replace(' border-', ' ')}`}>
                        {anomaly.severity.toUpperCase()}
                      </span>
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap">
                      <div className="text-sm text-gray-900">
                        {new Date(anomaly.timestamp).toLocaleTimeString()}
                      </div>
                      <div className="text-xs text-gray-500">
                        {new Date(anomaly.timestamp).toLocaleDateString()}
                      </div>
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap">
                      <button
                        onClick={() => toggleRow(anomaly.id)}
                        className="btn btn-secondary text-sm"
                      >
                        {expandedRows.has(anomaly.id) ? (
                          <>
                            <ChevronDown className="h-4 w-4 mr-1" />
                            Hide Details
                          </>
                        ) : (
                          <>
                            <ChevronRight className="h-4 w-4 mr-1" />
                            View Details
                          </>
                        )}
                      </button>
                    </td>
                  </tr>
                  {expandedRows.has(anomaly.id) && (
                    <tr className="bg-gray-50">
                      <td colSpan={5} className="px-6 py-6">
                        <div className="bg-white rounded-lg p-4 border border-gray-200">
                          <h4 className="text-sm font-semibold text-gray-900 mb-3">Technical Details</h4>
                          {renderDetails(anomaly)}
                        </div>
                      </td>
                    </tr>
                  )}
                </React.Fragment>
              ))}
            </tbody>
          </table>

          {filteredAnomalies.length === 0 && (
            <div className="text-center py-12">
              <div className="w-16 h-16 bg-gray-100 rounded-full flex items-center justify-center mx-auto mb-4">
                <AlertTriangle className="h-8 w-8 text-gray-400" />
              </div>
              <h3 className="text-lg font-medium text-gray-900 mb-2">No Anomalies Found</h3>
              <p className="text-gray-500">
                No anomalies match the current filter criteria.
              </p>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default AnomaliesTable;
